    const [facts, setFacts]=useState([]);
   
const load = async () => {
            try {
                const resp = await axios(
                "https://cat-fact.herokuapp.com/facts"
                )
                console.log(resp)
                setFacts(resp)
            } catch (err) {
                console.log(err)
            }
        }
    return (
        load
        (<div>
            <ul>
                <li>
                    {
                        JSON.stringify(facts)
                    }
                </li>
            </ul>
        </div>)
    );



}

